import Calendar from "../../Component/Calendar/Calendar";
import { getAllrecords } from "../../Service/UserService";

const Calview = () =>{
    const [data, setData] = useState([]);

    useEffect(()=>{
        getAllrecords()
          .then(records => {
            console.log(records);
            setData([records.message, records.startdate, records.endate]);
          })
    },[]);

    return (
        <div className="container max-auto px-5 ">
            <Calendar {...data}/>
        </div>
    )
}


export default Calview;
